AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA//uSQP+AAAAAN4AAAAAAAAbwAAAAAAAA3gAAAAAAABvAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAP/7kkD/gAAAADeAAAAAAAAG8AAAAAAAAN4AAAAAAAAbwAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAD/+5JA/4AAAAA3gAAAAAAABvAAAAAAAADeAAAAAAAAG8AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA//uSQP+AAAAAN4AAAAAAAAbwAAAAAAAA3gAAAAAAABvAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA=="
        />

    </div>
    <script>
      const tabText = document.querySelector(".tab-text");
      const hand = document.querySelector(".hand");
      const simple = document.querySelector(".simple");
      const mango = document.querySelector(".mango");
      const honeycomb = document.querySelector(".honeycomb");
      const logo = document.querySelector(".logo");
      const simpleTouchBlock = document.querySelector(".simple-touch-block");
      const mangoTouchBlock = document.querySelector(".mango-touch-block");
      const music = document.getElementById("music");
      const popSound = document.getElementById("touch");

      const configAnimation = {
        portrait: {
          simple: {
            first: "-102.5vw",
            second: "-206vw",
            thirt: "-307vw",
          },
          mango: {
            width: 89.8,
          },
        },
        landscape: {
          simple: {
            first: "-58vh",
            second: "-117vh",
            thirt: "-175vh",
          },
          mango: {
            width: 54.4,
          },
        },
      };
      tabText.classList.add("tab-text-start-animation");
      simple.classList.add("simple-start-animation");

      setTimeout(() => {
        tabText.classList.remove("tab-text-start-animation");
        tabText.classList.add("tab-text-scale-animation");
        hand.style.display = "block";
        hand.classList.add("hand-touch-animation");
      }, 500);

      function handleButtonPress() {
        window.openAppStore();
      }

      document.addEventListener("visibilitychange", function () {
        if (document.visibilityState === "visible") {
          music.play();
        } else {
          music.pause();
        }
      });

      mangoTouchBlock.onclick = () =>
        mangoTouch(configAnimation[getOrientation()]);
      simpleTouchBlock.onclick = () =>
        simpleTouched(configAnimation[getOrientation()]);
      honeycomb.onclick = handleButtonPress;

      function playSound(id) {
        const audio = document.getElementById(id);
        audio.currentTime = 0;
        audio.play();
      }

      function simpleTouched(object) {
        playSound("music");
        playSound("touch");
        simple.style.backgroundPositionX = object.simple.first;
        tabText.style.display = "none";
        hand.classList.remove("hand-touch-animation");
        hand.style.display = "none";
        simpleTouchBlock.remove();
        setTimeout(() => {
          simple.style.backgroundPositionX = object.simple.second;
          playSound("touch");
        }, 800);
        setTimeout(() => {
          simple.style.backgroundPositionX = object.simple.thirt;
          playSound("touch");
        }, 1200);
        setTimeout(() => {
          simple.classList.remove("simple-start-animation");
          simple.classList.add("simple-transtion-animation");
          mango.style.display = "block";
          mango.classList.add("mango-appears-animation");
          tabText.style.display = "block";
        }, 1500);
        setTimeout(() => {
          simple.style.display = "none";
          hand.style.display = "block";
          hand.classList.add("hand-touch-animation-mango");
          mangoTouchBlock.style.display = "block";
        }, 2200);
      }

      function mangoTouch() {
        hand.style.display = "none";
        hand.classList.remove("hand-touch-animation-mango");
        tabText.style.display = "none";
        mangoTouchBlock.remove();

        animateMango(0);
      }

      function animateMango(i) {
        const spriteFrames = 15;
        let units = getOrientation() === "portrait" ? "vw" : "vh";
        const widthSprite = configAnimation[getOrientation()].mango.width;
        if (i <= spriteFrames) {
          setTimeout(() => {
            const position = i * widthSprite;
            mango.style.backgroundPositionX = `-${position}${units}`;
            playSound("touch");
            animateMango(i + 1);
          }, 200);
        }
        if (i === spriteFrames) {
          mango.classList.remove("mango-appears-animation");
          mango.classList.add("mango-transtion");
          honeycomb.style.display = "block";
          honeycomb.classList.add("honeycomb-appears-animation");
          setTimeout(() => {
            mango.style.display = "none";
            logo.style.display = "block";
            hand.style.display = "block";
            hand.classList.add("hand-touch-animation-honey");
          }, 500);
        }
      }
    </script>
